import React from 'react'
import data from '../data/data.json'
import PgDetails from '../feature/pgdetails/index'
import '../feature/pgdetails/menu.css'

export default function Pgdetails (props) {
    return(
        <div>
            {
                console.log(props.location.data.cityname),
                console.log(props.location.data.cityarea),
                console.log(props.location.data.startdate),
                console.log(props.location.data.enddate),
                console.log(props.location.data.noofguest),
                console.log('dislay')
            }
        <PgDetails></PgDetails>
        </div>
    )
}
